// src/pages/LogsPage.jsx
import React, { useState } from 'react';

function LogsPage() {
  const [searchTerm, setSearchTerm] = useState("");
  const [level, setLevel] = useState("");
  const [date, setDate] = useState("");

  // Örnek sabit log verisi
  const logs = [
    { id: 1, time: "2025-02-11 09:15", ip: "192.168.1.15", level: "INFO", message: "Bağlantı Sağlandı" },
    { id: 2, time: "2025-02-11 09:17", ip: "10.0.0.25", level: "ERROR", message: "Erişim Reddedildi" }
  ];

  const handleFilter = () => {
    console.log("Filtre Uygula", { searchTerm, level, date });
    // TODO: axios vb. ile sunucuya istek atılabilir
  };
  const exportCSV = () => {
    console.log("CSV çıktı...");
  };
  const exportPDF = () => {
    console.log("PDF çıktı...");
  };

  return (
    <div>
      <h2 className="mb-3">Log Yönetimi</h2>

      <div className="card p-3 mb-3">
        <div className="row g-2">
          <div className="col-sm">
            <input
              className="form-control"
              placeholder="Anahtar Kelime"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          <div className="col-sm">
            <select
              className="form-select"
              value={level}
              onChange={(e) => setLevel(e.target.value)}
            >
              <option value="">Seviye</option>
              <option value="INFO">INFO</option>
              <option value="WARN">WARN</option>
              <option value="ERROR">ERROR</option>
            </select>
          </div>
          <div className="col-sm">
            <input
              type="text"
              className="form-control"
              placeholder="gg.aa.yyyy"
              value={date}
              onChange={(e) => setDate(e.target.value)}
            />
          </div>
          <div className="col-auto">
            <button className="btn btn-primary me-2" onClick={handleFilter}>
              FİLTRE UYGULA
            </button>
            <button className="btn btn-outline-info me-2" onClick={exportCSV}>
              CSV ÇIKIŞI
            </button>
            <button className="btn btn-outline-info" onClick={exportPDF}>
              PDF ÇIKIŞI
            </button>
          </div>
        </div>
      </div>

      <table className="table table-bordered align-middle">
        <thead>
          <tr>
            <th>Tarih/Saat</th>
            <th>Kaynak IP</th>
            <th>Seviye</th>
            <th>Mesaj</th>
            <th>İşlem</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log) => (
            <tr key={log.id}>
              <td>{log.time}</td>
              <td>{log.ip}</td>
              <td>{log.level}</td>
              <td>{log.message}</td>
              <td>
                <button className="btn btn-sm btn-info">İNCELE</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="d-flex justify-content-between mt-3">
        <button className="btn btn-secondary">ÖNCEKİ</button>
        <span>Sayfa 1/5</span>
        <button className="btn btn-secondary">SONRAKİ</button>
      </div>
    </div>
  );
}

export default LogsPage;
